let initialState = {
  pokemons: [],
};

const pokemonReducer = (state = initialState, action) => {
  switch (action.type) {
    case '': {
      return state;
    }
    default:
      return state;
  }
};

export const getPokemonActionCreator = { type: 'GET_POKEMON', pokemons };

export default pokemonReducer;
